import './../App.css';
import Webgl from './Webgl';
import Interface from './Interface';
import Header from './Header';

function App() {
  return (
    <div className="App">
      <Webgl />

      <div className="wrap">
        <Header num="1"/>
        <Interface />
      </div>
    </div>
  );
}

export default App;
